import './css/App.css';
import './css/Global.css'
import './css/Biography.css'

import Me from './media/Me.jpg';

import Header from "./components/Header"
import Section from './components/Section';
import Main from './components/Main';
import RotatingText from './components/RotatingText';

function App() {
  return (
    <>
      <Header />
      <Main>
        <Section id="Biography">
          <div className='flex'>
            <img className='me-image' alt='Me' src={Me} />
            <div className='rotating'>
              <div className='rotating-const'>Hello, I'm</div>
              <div className='texts'>
                <RotatingText anim="anim-1">Heitor Silva</RotatingText>
                <RotatingText anim="anim-2">a Web Developer</RotatingText>
                <RotatingText anim="anim-3">a Software Developer</RotatingText>
                <RotatingText anim="anim-4">a Coding Lover</RotatingText>
              </div>
            </div>
          </div>
        </Section>
        <Section id="Skills">Skills</Section>
        <Section id="Experience">Experience</Section>
        <Section id="Projects">Projects</Section>
        <Section id="Quotes">Quotes</Section>
      </Main>
    </>
  );
}

export default App;
